import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Herosection from './components/Herosection';
import About from './components/skills';
import Project from './components/Project';
import Footer from './components/Footer';
import Nostraoverview from './components/nostraoverview';
import './App.css'
import Nostra1 from './components/nostra1';

function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Herosection />
        <About />
        <Project />
        <Routes>
            {/* <Route path="/nostraoverview" element={<React.Fragment><Click /><Nostaoverview /></React.Fragment>} /> */}
            <Route path='/nostraoverview' compo={<Nostraoverview />}></Route>
            <Route path='/nostra1' element={<Nostra1 />}></Route>

        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
